const { resources, sim } = input;

return resources.map((x) => ({
  ...x,
  id: `${sim}:${x.id}`,
  sim,
  type: x.type.id,
}));

const { sim, type } = input;

const filters = [];

if (sim) {
  filters.push({
    fieldName: "sim",
    op: "==",
    value: { ID: sim },
  });
}

if (type) {
  filters.push({
    fieldName: "type",
    op: "==",
    value: { ID: type },
  });
}

return filters;
